import React from 'react'
import {View, Text} from 'react-native'

const ChatScreen = () => {
    useEffect(() => {
        navigation.setOptions({
           headerShown: true,
        });
    }, [navigation]);
    return(
        <View>
            <Text>I am the chat screen.</Text>
        </View>
        )
}

export default ChatScreen
